edition = "2023";

package youtube.api.innertube;

import "youtube/api/innertube/clearcut_event.proto";
import "youtube/api/innertube/clearcut_log_action.proto";

option java_package = "com.google.protos.youtube.api.innertube";
option java_multiple_files = true;
option cc_enable_arenas = true;
option objc_class_prefix = "YTI";

message ThirdPartyLogMonitoringEvent {
	ClearcutEvent clearcut_event = 1;
	ClearcutLogAction clearcut_log_action = 2;
}
